window.bookSummaryJSON = "<p>A man broken by despair and depression, Grant Legate finds himself in a once-in-a-lifetime situation after receiving an Ultimate Edition copy of Continue Online. All he wishes for is a distraction from the thoughts plaguing his waking hours. He dives in headfirst, unknowing of the AI's intentions. They offer him the chance to play as one of their own, a NPC deserving of a proper send off. What he discovers during the journey shakes Grant to his very core.</p>"; 
